import React from 'react';
import BaseLayout from '../components/layouts/BaseLayout';

import SuperComponent from '../components/SuperComponent';

class Human {
    talk() {
        console.log('! im talking')
    }
    static walk(){
        console.log('I am walking ')
    }
}

class Index extends SuperComponent {

    static getInitialProps() {
        console.log('I am get Intial Props')

        return {};
    }

    constructor(props) {
        super(props);

        this.state = {
            title: 'I am Index Page '
        }

        console.log('constructor');
    }

    componentDidMount() {
        console.log('componenDidMount');

        Human.talk();
    }

    componentDidUpdate() {
        console.log('componenDidUpdate');
    }

    componentWillUnmount() {
        console.log('componenWillUnmount')
    }

    updateTitle() {
        // console.log('i am update title')
        this.setState({ title: 'I am Update Index Page' })
    }

    render() {
        const { title } = this.state;

        return (
            <BaseLayout>
                <h1>I am index page from Class Componenet</h1>
                <h3>{this.state.title}</h3>
                <button onClick={() => this.updateTitle()}>Change Title</button>
            </BaseLayout>
        )
    }
}

export default Index;
